import React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";
import { green } from "@mui/material/colors";
import { TextField } from "@mui/material";
import { Grid } from "@mui/material";
import CategoryListComponent from "./CategoryListComponent";
import MenuOptionComponent from "./MenuOptionComponent";

function AddMenuComponent() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [selectedIndex, setSelectedIndex] = React.useState(0);
  const open = Boolean(anchorEl);
  const handleClickListItem = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const theme = createTheme({
    palette: {
      primary: {
        main: green[200],
      },
      secondary: {
        main: green[500],
      },
    },

    components: {
      MuiCard: {
        styleOverrides: {
          root: { margin: 8, maxWidth: 345}
        },
      },
    },
  });

  function ButtonAppBar() {
    return (
      <ThemeProvider theme={theme}>
        <AppBar position="static">
          <Toolbar>
            {/* <IconButton
              size="large"
              edge="start"
              color="inherit"
              aria-label="menu"
              sx={{ mr: 2 }}>
              <MenuIcon />
            </IconButton> */}
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Menu
            </Typography>
            {/* <Button color="inherit">Edit</Button> */}
          </Toolbar>
        </AppBar>
      </ThemeProvider>
    );
  }

  return (
    <>
        <ButtonAppBar></ButtonAppBar>
        <Button variant="contained" style={{maxWidth: '100px', maxHeight: '30px', minWidth: '30px', minHeight: '30px'}}>Add</Button>
        <Button variant="contained">Edit</Button>
        <h1>Add Menu Item</h1>
        <Grid container spacing={2}>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Category" variant="outlined" />
        </Grid>
        <Grid item xs={8}>
          <TextField id="outlined-basic" label="Name" variant="outlined" />
        </Grid>
        <Grid item xs={8}>
        <TextField id="outlined-basic" label="Options" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
          <TextField id="outlined-basic" label="Price" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Cost" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
        <TextField id="outlined-basic" label="Amount" variant="outlined" />
      </Grid>
      <Grid item xs={8}>
        <Button variant="contained">Save</Button>
      </Grid>
    </Grid>

    </>
  );
}

export default AddMenuComponent;
